import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import PaperTrade from './PaperTrade';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter } from "react-router-dom";


const userJSON = 
  {
    "_id": {
        "$oid": "61e83b060f564c8939df653d"
    },
    "username": "huang7178",
    "password": "daisy123",
    "portfolio": {
        "name": "Tech Stocks",
        "cash": 1000000
    },
    "stocks": [
      {
        "symbol": "AAPL",
        "quantity": 100,
        "pricePurchased": 175.35
      },
      {
        "symbol": "AMZN",
        "quantity": 200,
        "pricePurchased": 3342.32
      }]
}

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <PaperTrade userJSON={userJSON}/>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);

